import React from "react";
import { Outlet } from "react-router-dom";
import Log from "./Log";
import axios from "axios";
import Home from "./Home";
function Pr() {
  const ud = sessionStorage.getItem("ud");
  let per = false;
  const v = async() => {
    if (ud !== null || ud !== undefined) {
      console.log(ud);
      await axios.post("http://localhost:4000/pr", { ud: ud }).then((res) => {
        console.log(res.data.per);
        if (res.data.per === "ac") {
          per = true;
        } else {
          per = false;
        }
      });
    }
  }
  v()
  return (per ? <Outlet /> : <Log />);
}
export default Pr;
